    setSearchText(event){

        const searchText = event.nativeEvent.text;
        this.setState({searchText});
        const campaigns =  this.state.campaigns;

        let filteredData = this.filterNotes(searchText, this.state.campaigns);
        this.setState({
            campDataSource: ds.cloneWithRows(filteredData)

        });
    }

    filterNotes(searchText, notes) {
        let text = searchText.toLowerCase();
        return notes.filter((n) => {
            let note = n.description.toLowerCase();
            let note2 = n.title.toLowerCase();
            return note.search(text) !== -1 || note2.search(text) !== -1;
        });
    }





